import { useDispatch, useSelector } from "react-redux";
import {
  fetchReposAction,
  fetchProfileAction,
} from "./redux/slices/reposSlice";
import { useEffect } from "react";
function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchReposAction("tweneboah"));
    dispatch(fetchProfileAction("tweneboah"));
  }, []);
  return (
    <>
      <div class="vh-100 inline-block p-3 bg-danger">Width 25%</div>
    </>
  );
}

export default App;
